export type CanvasWorkflowState = 'submitted' | 'pending_review' | 'graded' | 'unsubmitted';
export type Submission = {
    id: string;
    body: string;
    url: string | null;
    grade: string;
    score: number;
    submitted_at: string;
    assignment_id: string;
    user_id: string | number;
    submission_type: string;
    workflow_state: CanvasWorkflowState;
    grade_matches_current_submission: boolean;
    graded_at: string;
    grader_id: string;
    attempt: number;
    cached_due_date: string;
    excused: string | null;
    late_policy_status: string | null;
    points_deducted: string | null;
    grading_period_id: string | null;
    extra_attempts: string | null;
    posted_at: string;
    redo_request: boolean;
    custom_grade_status_id: string | null;
    sticker: string | null;
    late: boolean;
    missing: boolean;
    seconds_late: number;
    entered_grade: string;
    entered_score: number;
    preview_url: string;
    anonymous_id: string;
};
